(1138, 10, 'plb67qaf1479', 'beneficio_justificativa', 'O VALE-REFEICAO PODERIA SER MAIOR OU IGUAL AOS DOS PROMOTORES. ESTAR NA RUA E CONSEGUIR REFEICOES MEDIANAS COM UM VALOR OFERTADO PELO VALE, E DIFICIL. O PROGRAMA DE PPR ELE E DIRETAMENTE AFETADO POR QUESTOES QUE FOGEM DO VENDEDOR, TEMOS QUE TRABALHAR COM ANTECIPACAO DE PEDIDOS PARA FATURAMENTO, PORQUE, ALEM DE NAO TERMOS O ESTOQUE EM TEMPO REAL, CORREMOS O RISCO DO NAO FATURAMENTO DOS PEDIDOS ENVIADOS NO ULTIMO DIA DO MES. TORNANDO O PPR UMA VARIAVEL MUITO MENOR DO QUE PODERIA SER.', 0, 0, 94, 0, 0),
