(1169, 10, 'plb67qaf1479', 'tecnologia_informacao_justificativa', 'INFORMACOES IMPORTANTES PARA QUEM ESTA NA PONTA, POR MUITAS VEZES VEM DE FORMA ERRADA OU QUANDO SE QUESTIONA, EM ALGUNS MOMENTOS NAO TEMOS RESPOSTAS COERENTES.', 0, 0, 94, 0, 0),
