(1171, 10, 'plb67qaf1479', 'comentario_fazenda', 'GOSTO DE TRABALHAR NA PREMIERPET, EXISTEM ALGUMAS LACUNAS QUE DESESTIMULAM QUEM ESTA NA PONTA. COMO A FALTA OU INFORMACAO ERRADA, METRICAS DE METAS SEM SENTIDOS DE CAMPANHAS, AS VEZES VOCE SOFRE FINANCEIRAMENTE PELA FALTA DE INFORMACAO OU PELA FALTA DE PRODUTOS. QUANDO FOI VENDIDO O PRODUTO, INDEPENDENTE DE TER OU NAO, JA QUE NAO TEMOS O ESTOQUE EM TEMPO REAL EM NOSSO TABLET. PRETENDO CRESCER AQUI DENTRO, ME ADAPTANDO CADA VEZ MAIS A ESSES PERCALCOS NO CAMINHO.', 0, 0, 94, 0, 0),
