(5380, 10, 'pzcwqt7v1181', 'comentario_fazenda', 'BOA EMPRESA, MUITO BONS BENEFICIOS, GESTORES EXCEPCIONAIS EM QUESTAO DE CONHECIMENTOS E LIDERANCA. ALTA CAPACITACAO TECNICA PARA OS COLABORADORES. MAS, SEM PERSPECTIVA DE CRESCIMENTO FORA DA AREA DE SAO PAULO. ALTA ROTATIVA EM EQUIPE, MUITO POR EXAUSTAO DE FUNCIONARIOS, SEJA POR METAS MUITO ALTAS (NEM SEMPRE CONDIZENTES COM AS LOJAS ATENDIDAS), ALTA EXIGENCIA DE NUMERO DE FOTOS, ACABA FALTANDO UM POUCO DE QUALIDADE DE VIDA AOS FUNCIONARIOS POR PEGAREM ROTAS EXTREMAMENTE DISTANTES DE SUAS RESIDENCIAS.', 0, 0, 92, 0, 0),
