(6423, 10, 'pcvxvmtx1314', 'direcao10', '3', 0, 0, 92, 0, 0),
(6424, 10, 'pcvxvmtx1314', 'direcao_justificativa', 'SOBRE OS ITENS QUE COLOQUEI QUE DISCORDAVA PARCIALMENTE, ME REFIRO AOS PROCESSOS E ROTINAS QUE AUMENTAM DE FORMA DESCOORDENADA, CRIANDO MILHARES DE DEMANDAS URGENTES AOS GESTORES DE MERCHAN, SEM COLOCAR MAIS GESTORES PARA ATENDIMENTOS NAS REGIOES, HOJE CONTABILIZANDO MAIS DE 50 PROMOTORES PARA CADA GESTOR, QUE RODA KMS PARA DAR APOIO A REGIAO, COM POUCOS PROMOTORES LIDERS E APOIO (NO MEU CASO TENHO SOMENTE 1), E DESTA FORMA VIVEMOS APAGANDO INCENDIOS, VIVENDO UM TRABALHO DE FORMA INSANA E CORRIDA, SEM MUITA ORGANIZACAO DO SETOR QUE PRECISA ATENDER A TODA A EMPRESA, SEM MUITA ORGANIZACAO ANTECIPADA DE INFORMACOES. SOBRE A PARTE QUE FALEI SOBRE A MUDANCA DO ANO ANTERIOR PARA ESTE, ME REFIRO AO MESMO ASSUNTO FALADO ANTERIORMENTE: AS EQUIPES AUMENTARAM, O TRABALHO MAIS QUE DOBROU, MUITAS INFORMACOES CHEGANDO DE DIVERSOS NOVOS GESTORES DE OUTRAS AREAS E NOVOS SETORES, E O MERCHAN CONTINUA COM SEUS POUCOS GESTORES FAZENDO MALABARISMO PARA ACOMPANHAR O CRESCIMENTO DA EMPRESA, TENDO QUE AUXILIAR A TODOS SEM MUITA DIVISAO DE TAREFAS, DESTA FORMA CONCLUO QUE A EMPRESA DE FORMA GERAL POSSA TER MELHORADO, MAS A DEMANDA DO SETOR DE MERCHAN E ORGANIZACAO SOMENTE PIOROU NESTE TEMPO.', 0, 0, 92, 0, 0),
