(6452, 10, 'pcvxvmtx1314', 'gestores_justificativa', 'NESTE TOPICO NAO SINTO QUE SOU RECONHECIDA DESDE O MOMENTO QUE NOSSO SALARIO DE COORDENADOR E O MENOR E DIFERENTE DE TODOS OS DEMAIS QUE POSSUEM O MESMO CARGO NA EMPRESA. MAIS AINDA EM SABER QUE DENTRO DO MEU SETOR NAO TENHO MAIS PARA ONDE CRESCER MESMO TENDO QUASE 8 ANOS DE CASA. SOBRE O TOPICO EM TER LIBERDADE EM FALAR COM MEU SUPERIOR IMEDIATO, FICA COMPLICADO DESDE O MOMENTO QUE LIGAMOS OU MANDAMOS MENSAGENS E A PESSOA LEVA AS VEZES UM DIA PARA RESPONDER, ISSO QUANDO RESPONDE, E ASSIM FICAMOS MUITAS VEZES ATE INSEGUROS PARA TOMAR ALGUMAS DECISOES, JA QUE O SETOR NAO DA ESSA LIBERDADE MESMO QUE ESTEJA EM UM CARGO CONSIDERADO DE CONFIANCA, MESMA COISA EM RELACAO A SITUACOES QUE ME ACHO INJUSTICADO OU CORRETO, MAS INFELIZMENTE NAO TENHO APOIO.', 0, 0, 92, 0, 0),
