(6466, 10, 'pcvxvmtx1314', 'comentario_fazenda', 'APESAR DA PREMIER SER UMA EMPRESA MUITO BOA DE SE TRABALHAR, GOSTARIA DE DEIXAR REGISTRADO ALGUNS PONTOS QUE PERCEBO DE INSATISFACAO MINHA, DE MEUS COLEGAS PARES E DE MINHA EQUIPE:UM PONTO E EM RELACAO A PROMOCOES, DE FORMA GERAL. A MINHA EQUIPE QUANDO E PROMOVIDA PODE SER APENAS 2 COLABORADORES POR ANO, LEVANDO EM CONSIDERACAO QUE TENHO 52, QUANDO OS DEMAIS SERIAM PROMOVIDOS? O MESMO ACONTECE COM NOSSO CARGO DE COORDENADOR, AO QUAL NAO EXISTE OUTRO ACIMA E ASSIM FICAMOS POR ANOS PARADOS NA MESMA FUNCAO SEM PODER HAVER UMA PROMOCAO DENTRO DO SETOR, O QUE NOS LEVA A PROCURAR OUTROS SETORES OU MESMO OUTRAS EMPRESAS PARA DAR CONTINUIDADE AO NOSSO CRESCIMENTO PROFISSIONAL.OUTRO PONTO DE VISTA E VER E SABER QUE O MESMO CARGO EM OUTROS SETORES POSSUEM VALORES SALARIAIS MUITO MAIS ATRATIVOS QUE O NOSSO NO MERCHAN, O QUE FAZ NOS SENTIR DESVALORIZADOS DENTRO DA EMPRESA. OS COORDENADORES COMERCIAIS VIRARAM SUPERVISORES, COM SALARIOS MELHORES E CARROS DIFERENCIADOS, OS COORDENADORES DE TRADE ALEM DE BONIFICACAO JA POSSUEM UM PISO SALARIAL MAIS ATRATIVO COM PROMOCOES MAIS RAPIDAS, ASSIM COMO OS DEMAIS CANAIS COMO VETS E ETC. E NOS DO MERCHAN NAO TEMOS BONUS SALARIAL, O MENOR SALARIO COM A MAIOR RESPONSABILIDADE DE EQUIPE (MEDIA DE 50 COLABORADORES), USAMOS POR MUITO TEMPO OS MESMOS VEICULOS E MATERIAIS DE VENDEDORES MESMO COM DIFERENCIACAO DE CARGO.OS BENEFICIOS COMO VR PODERIA SOFRER AJUSTES, VISTO QUE A ALIMENTACAO AUMENTOU CONSIDERAVELMENTE, ASSIM COMO REEMBOLSO DE KM, POIS EM ALGUNS ESTADOS, ASSIM COMO O MEU, TEMOS O MAIOR VALOR DE COMBUSTIVEL DO BRASIL E OBVIAMENTE O QUE RECEBEMOS NAO COBRE AS DESPESAS MENSAIS.ACHO QUE O RECONHECIMENTO PELO PROFISSIONAL E MUITO IMPORTANTE PARA NOS SENTIRMOS VALORIZADOS.E PARA FINALIZAR, A IDEIA DE CONTRATACAO DE MAIS GESTORES PARA O MERCHANDISING, VISTO QUE E IMPOSSIVEL UM GESTOR TER EXCELENTE QUALIDADE DE TRABALHO COM UMA EQUIPE DE MAIS DE 50 COLABORADORES, PRESTANDO ASSISTENCIA A TODOS OS VENDEDORES E LOJISTAS DA REGIAO ATENDIDA, REALIZANDO ACOES DE MERCHANDISING E GERINDO FORNECEDORES, TRABALHANDO COM RELATORIOS MENSAIS TANTO DA VD COMO DAS DISTRIBUIDORAS TAMBEM ATENDIDAS E VISITADAS, FAZENDO COACHING DE NO MINIMO 3H COM CADA PROMOTOR DA REGIAO EM LOJA, ENTREGA DE MATERIAIS, CONTRATACAO, DEMISSAO, TREINAMENTO, REUNIOES, VIAGENS, EVENTOS, INAUGURACAO DE LOJAS, CAMPANHAS E DIVERSAS OUTRAS FUNCOES QUE COMPETEM AO CARGO, SENDO SOZINHO NA REGIAO.', 0, 0, 92, 0, 0),
