(7725, 6, 'pcwywgpo1266', 'gestores_justificativa', 'MEU SUPERIOR CONHECE MUITO DO ASSUNTO E DA AREA, MAS INFELIZMENTE NAO REALIZA UMA GESTAO DE PESSOAS MUITO BOA. MANTEM COLABORADOR QUE APLICA O ASSEDIO MORAL DENTRO DA AREA SEM PUNICOES, MESMO A PESSOA INFORMANDO AO GESTOR, NAO ACONTECEU NADA A RESPEITO PARA MUDAR A SITUACAO, SITUACAO ESSA QUE SE FOSSE EM UMA EMPRESA MAIOR O COLABORADOR(A) JA TERIA SIDO DEMITIDO(A), COLABORADORES DE NIVEIS MENORES COMO JUNIOR REALIZANDO ATIVIDADES DE SENIOR SEM O DEVIDO RECONHECIMENTO OU UMA EXPECTATIVA DE CRESCIMENTO NA AREA E CASO O COLABORADOR(A) DESEJA APRENDER ALGO NOVO ELE/ELA PRECISA CORRER ATRAS SOZINHO SEM NENHUMA ORIENTACAO.', 0, 0, 5, 0, 0),
