(7730, 6, 'pcwywgpo1266', 'recursos_humanos_justificativa', 'NOS NAO POSSUIMOS UM RH, PRECISA MELHORAR OS BENEFICIOS URGENTEMENTE, PRECISA OLHAR MELHOR OS AUXILIOS QUE ELES APLICAM AOS SEUS COLABORADORES E MELHORAR O AMBIENTE DE TRABALHO, TEMOS AR CONDICIONADOS QUEBRADOS TENDO QUE TRABALHAR NO CALOR COM MAIS DE 30, NAO POSSUIMOS AREA DE DESCANSO E UMA COPA MUITO PEQUENA PARA O TAMANHO DA EMPRESA.', 0, 0, 5, 0, 0),
