(7737, 6, 'pcwywgpo1266', 'tecnologia_informacao_justificativa', 'AINDA PRECISAMOS DE EQUIPAMENTOS DE ESCRITORIOS COMO FONE, MOUSE, TECLADO E TELA PARA EXECUTAR O NOSSO TRABALHO; SISTEMA DATASUL MUITO ANTIGO JA NAO SUPORTA A QUANTIDADE DE DADOS QUE A EMPRESA EXIGE, SEMPRE DANDO PROBLEMA E ATRASANDO AS ATIVIDADES E OS PROJETOS DE MELHORIAS SEMPRE DEMORAM PARA SEREM REALIZADOS.', 0, 0, 5, 0, 0),
(7738, 6, 'pcwywgpo1266', 'trabalho', '2', 0, 0, 5, 0, 0),
(7739, 6, 'pcwywgpo1266', 'comentario_fazenda', 'PARA A EMPRESA MELHORAR SEU AMBIENTE INTERNO EU RECOMENDO QUE ANALISAREM MELHOR OS BENEFICIOS COMO VR, AUX. HOME OFFICE E AUX. ESTACIONAMENTO, INCLUIR TODAS AS AREAS NOS EVENTOS DA EMPRESA, OLHAR A ESTRUTURA COMO COPA E AREA DE DESCANSO QUE NAO POSSUIMOS ATUALMENTE, MAS A FABRICA POSSUI. DEIXAR BEM CLARO O PLANO DE CARREIRA DA EMPRESA, VOU FAZER 3 ANOS NA EMPRESA E JA FACO ATIVIDADE DE SENIOR, MINHA GESTORA RECONHECE ISSO, MAS NAO CONSEGUE ME EFETIVAR PARA A VAGA E COM ISSO EU CONTINUO COMO JUNIOR, EXISTE OU NAO O PLANO DE CARREIRAS? E CUIDAR MAIS DOS SEUS COLABORADORES PARA EVITAR CASOS DE ASSEDIO MORAL E QUE AS PUNICOES SEJAM TOMADAS SEM QUE A GESTORA FIQUE COM MEDO DE REALIZAR A PUNICAO.', 0, 0, 5, 0, 0),
