(8799, 6, 'pkv0c3uh1084', 'comentario_fazenda', '1 SERIA INTERESSANTE A VOLTA DE 2 DIAS HOME OFFICE AO INVES DE 1 DEVIDO DESGASTE COM O TRANSITO DE SAO PAULO.2 MELHORAR O VR PARA OPCAO CREDITO POIS GRANDE PARTE DO ESCRITORIO UTILIZAM EM MERCADO POREM POUCOS ACEITAM A OPCAO VALE REFEICAO.3 FESTA DE FINAL DE ANO PODERIA VOLTAR, POIS DESDE A PANDEMIA NUNCA MAIS TEVE E E IMPORTANTE PARA OS DEPARTAMENTOS SOCIALIZAREM, SINTO QUE POR ESTARMOS DIVIDIDOS POR ANDARES NAO TEMOS CONVIVENCIA COM AS DEMAIS AREAS.', 0, 0, 5, 0, 0),
