(8994, 6, 'poo0p7ua4716', 'beneficio_justificativa', 'GOSTARIA DE TRAZER A ATENCAO A QUESTAO DO VALOR DO VALE-REFEICAO OFERECIDO. APOS IR EM ALGUNS RESTAURANTES PARA CONHECER E TENTAR ESCOLHER UM QUE SE ADEQUE A UMA ALIMENTACAO ADEQUADA E DE BOA QUALIDADE CONSTATEI QUE O VALOR QUE TEMOS FOGE UM POUCO DO PRECO QUE OS RESTAURANTES BONS COBRAM.  A MEDIA COSTUMA SER DE R$50 A R$55 COM GASTOS EM LOCAIS QUE GARANTEM UMA ALIMENTACAO ADEQUADA E SAUDAVEL TEM SE MOSTRANDO SUPERIOR AO VALOR DO VALE-REFEICAO QUE TEMOS HOJE. ALEM DISSO, CONSIDERO QUE A IMPLEMENTACAO DO CARTAO COM MULTIPLOS BENEFICIOS DO PROPRIO PARCEIRO QUE TEMOS ATUALMENTE (PLUXXE), SENDO DEPOSITADO TAMBEM NO MESMO CARTAO O AUXILIO HOME OFFICE E AUXILIO ESTACIONAMENTO, PODE SER UMA SOLUCAO EFICAZ. ESSE CARTAO PODERIA SER UTILIZADO NAO APENAS PARA REFEICOES, MAS TAMBEM EM SUPERMERCADOS, ESSA FLEXIBILIDADE CERTAMENTE CONTRIBUIRIA PARA A SATISFACAO GERAL DOS COLABORADORES EM RELACAO AO BENEFICIO.', 0, 0, 11, 0, 0),
