(9853, 12, 're6hisytez329', 'direcao_justificativa', 'NAO ME SINTO VALORIZADA NO CARGO EM QUE OCUPO, TANTO FINANCEIRAMENTE QUANTO MORALMENTE. OS PROCESSOS EXISTEM, POREM AS PESSOAS NAO OS SEGUEM COMO DEVERIAM.', 0, 0, 0, 0, 0),
