(9861, 12, 're6hisytez329', 'beneficio_justificativa', 'NAO SOU CASADA NO PAPEL, POREM MORO COM MEU NAMORADO HA MAIS DE UM ANO E NAO CONSEGUI INCLUI-LO COMO DEPENDENTE NEM NO PLANO DE SAUDE E NEM NO ODONTOLOGICO. O VALE COMBUSTIVEL E POUCO PARA O MES NO TRAJETO QUE FACO CASA-TRABALHO; O COMBUSTIVEL NAO DURA ATE O FINAL DO MES. NAO UTILIZO E NEM PRETENDO UTILIZAR O CONVENIO DE FARMACIA. PARA MIM, MAIS IMPORTANTE QUE A FARMACIA E O CONVENIO COM ACADEMIA.', 0, 0, 0, 0, 0),
