(9890, 12, 're6hisytez329', 'comentario_fazenda', 'GOSTARIA QUE A GESTAO DAS PESSOAS FOSSE REALIZADA DE FORMA MAIS ASSERTIVA. FALANDO POR MIM, APESAR DE DAR SEMPRE O MEU MELHOR, SER PRO ATIVA E EXECUTAR TODAS AS TAREFAS POSSIVEIS, NAO ME SINTO VALORIZADA. JA SENTI VONTADE DE SAIR DA EMPRESA, POREM PERMANECI PELO COMPROMETIMENTO COM MEU TIME. OS COLABORADORES PRECISAM DE MAIS INCENTIVOS PARA PERMANECEREM, POIS NA CIDADE/VIZINHANCA TEM MUITAS OFERTAS DE EMPREGO E POR POUCO HA A DESISTENCIA DE MUITOS. INCENTIVOS NAO SOMENTE FINANCEIROS, MAS TAMBEM BENEFICIOS E PRINCIPALMENTE RECONHECIMENTO DOS TRABALHOS REALIZADOS.', 0, 0, 0, 0, 0),
