(12346, 6, 'pqeftrat1329', 'comentario_fazenda', 'A PREMIERPET E UMA BOA EMPRESA PARA SE TRABALHAR, O AMBIENTE E AGRADAVEL E RESPEITOSO NO MEU DEPARTAMENTO. MAS SINTO FALTA DE ALGUNS BENEFICIOS QUE ATE EMPRESAS MENORES TEM OFERECIDO, COMO AUXILIO CRECHE. O CARTAO FARMACIA TAMBEM FOI DE CERTA FORMA DECEPCIONANTE JA QUE NAO OFERECE DESCONTOS NOS PRODUTOS, APENAS O PARCELAMENTO DO VALOR. O VALE REFEICAO NAO E COMPATIVEL COM A MEDIA DE GASTOS DA REGIAO, LEMBRANDO QUE A MAIOR PARTE DOS COLABORADORES MORA LONGE E FICA FORA DE CASA POR VOLTA DE 12 HORAS POR DIA, SENDO NECESSARIO UMA ALIMENTACAO DE QUALIDADE PARA GARANTIR O MINIMO DE QUALIDADE DE VIDA. COMIDA BOA SEMPRE DEIXA PESSOAS FELIZES! FICO MAIS CONTENTE QUANDO CAI O VR DO QUE COM O PROPRIO SALARIO.UMA SUGESTAO UTOPICA: SERIA BEM LEGAL UMA AREA DE DESCOMPRESSAO NO ESCRITORIO :)', 0, 0, 11, 0, 0),
