(12901, 2, 'dqyxjt2155', 'comentario_distribuidor', 'BOM DIATRABALHEI NA EMPRESA NO FINAL DO ANO DE 2022 E INICIO DE 2023, FIZ UM TRABALHO MUITO BOM, ASSUMI UMA AREA QUE ESTAVA COM SERIOS PROBLEMAS DE ATENDIMENTO E COM MUITO TRABALHO E EXPERIENCIA DE 27 ANOS DE MERCADO CONSEGUI MUDAR O PANORAMA. PARA MINHA SURPRESA FOI DESLIGADO SEM UMA JUSTIFICATIVA CONVINCENTE. PEDI PARA DEMISSAO DO EMPREGO ANTERIOR PARA INGRESSAR NA P2PET E DEPOIS DE 6 MESES DE UM BOM TRABALHO ACABEI SENDO DISPENSADO PELA COORDENADORA RAFAELA E O GERENTE JAIRO POR TELEFONE. SEGUNDO O SR. JAIRO MINHA DISPENSA FOI OCASIONADA POR DAR PREFERENCIA AS PESSOAS QUE ESTAVAM NA EMPRESA A MAIS TEMPO. INFELIZMENTE FUI TRATADO COM FALTA DE RESPEITO E DESDEM. REPITO, EU ESTAVA EMPREGADO E PEDI DEMISSAO PARA INGRESSAR NA P2PET. MINHA IMPRESSAO SOBRE A EMPRESA INFELIZMENTE NAO E DAS MELHORES. VIDA QUE SEGUE E QUE TENHAM SORTE.', 17, 0, 0, 0, 0),
