(13974, 8, 'pnlradr22542', 'comentario_fazenda', 'OLA, TUDO BEM?QUERO AQUI DIZER O QUANTO ESTOU GRATO A ESSA EMPRESA, PELAS OPORTUNIDADES, QUERO DIZER O QUANTO ALEM DO PROFISSIONAL, ESSA EMPRESA PREENCHEU MEU CORACAO. A PREMIER PET FEZ EM MENOS DE UM ANO O QUE A ANTIGA EMPRESA ONDE ESTAVA NAO FEZ EM DOIS ANOS EM QUE ESTIVE POR LA: VALORIZAR E RESPEITAR O MEU TRABALHO.EM MENOS DE UM ANO VOCES REALIZARAM MEU SONHO DE SAIR DE RODAR TURNOS E VIR PRO HORARIO ADMINISTRATIVO, ME DERAM OPORTUNIDADES QUE JAMAIS IMAGINARIA, TAMBEM CONCLUI MEUS ESTUDOS NA FATEC, GRACAS AO APOIO DE VOCES COM O APROVEITAMENTO DE ESTAGIO, VOCES TEM UMA ESTRELA NISSO.NO ANO PASSADO QUANDO CHEGUEI, SEM NEM TER NOME EM LISTA NEM NADA, VOCES ME PRESENTEARAM COM A CESTA DE NATAL, A ANTIGA EMPRESA ONDE ESTAVA NAO FEZ ISSO, MESMO TENDO SAIDO NO FINAL DE ANO, ISSO FALA SOBRE O CARATER E RESPEITO DA EMPRESA COM AS PESSOAS, CONFESSO QUE ME EMOCIONA LEMBRAR DE TUDO ISSO. SO TENHO A AGRADECER A EMPRESA E MINHA LIDERANCA POR TODO APOIO E OPORTUNIDADES QUE TEM ME CONFIADO. ESPERO RETRIBUIR AS EXPECTATIVAS E CRESCER MUITO AQUI AINDA.AQUI DEIXO MINHA GRATIDAO E MEU DESEJO DE PERMANECER POR MUITO TEMPO NESSA CASA.', 0, 0, 102, 0, 0),
