(14416, 12, 'rt8lvuu16g334', 'direcao_justificativa', 'A EMPRESA, A MARCA, SEMPRE TIVERAM GRANDES POTENCIAS, MAS AS PESSOAS QUE ESTAO A FRENTE DELA PREJUDICAM A EMPRESA DE MELHORAR EM PROCESSOS E ORGANIZACAO. NA FORMA DE TRATAR, ENSINAR E CORRIGIR SEUS FUNCIONARIOS, SEMPRE FOI FEITO DE FORMA ABUSIVA E AGRESSIVA E SE POR ACASO TIVESSE DENUNCIA SOBRE OS OCORRIDOS ERAMOS CASTIGADOS, NOS TIRANDO ALGUNS BENEFICIOS. O RELACIONAMENTO ENTRE OS COLABORADORES, ACABA SENDO PREJUDICADO, POR QUANDO VAI TENTAR ELOGIAR UMA PESSOA, ACABA DIMINUINDO OUTRA E CAUSA RIVALIDADE DENTRO DOS SETORES PREJUDICANDO OS PROCESSOS. OS FUNCIONARIOS DAO SUGESTOES DE MELHORIAS, TENTANTAR IMPLANTAR, MAS A DIRECAO ACABA DANDO JEITINHO DE NAO SEGUIR O PROCESSO COM O DISCURSO SOU O DONO EU QUE MANDO.', 0, 0, 0, 0, 0),
