(14443, 12, 'rt8lvuu16g334', 'gestores_justificativa', 'E UMA PESSOA DESIQUILIBRADA, NAO TEM RESPEITO PELO OS FUNCIONARIOS, ONDE A FORMA DE CORRIGIR OU ATE MESMO NEM SABE O QUE ESTA ACONTECENDO OU O QUE OCORREU E GRITA E HUMILHA NA FRENTE DE TODOS, CHAMANDO O FUNCIONARIO DE BURRO E OUTROS ADJETIVOS, INCLUSIVE QUANDO O ERRO VEM DELE, O ERRO SEGUE SENDO DO FUNCIONARIO, SENDO QUE MUITAS VEZES NAO RECEBEMOS A INFORMACAO CORRETA E CLARA. QUANDO PASSADO UMA INFORMACAO, E DUVIDADA, SENDO A UNICA OPINIAO QUE VALE E A DELE.', 0, 0, 0, 0, 0),
