(15475, 10, 'paro5wgf1038', 'comentario_fazenda', 'ACREDITO QUE A EMPRESA PODERIA OFERTAR BOLSAS DE ESTUDOS EM POS GRADUACAO EM NUTRICAO PARA OS FUNCIONARIOS QUE FICAM EXTERNOSNA ULTIMA VEZ QUE ACONTECEU A SELECAO DE BOLSA DUAS QUE PESSOAS QUE GANHARAM FORAM FUNCIONARIOS INTERNOS E HOJE ELES NEM ESTAO NA EMPRESA, ACHO INJUSTO, OS FUNCIONARIOS EXTERNOS PERDEM MUITO, PORQUE AS VEZES PARECE QUE FAVORECE QUEM FICA INTERNOPROCESSOS COMO PROMOCAO DE CARGO, ACREDITO QUE DEIXA MUITO A DESEJAR, VOCE NAO SENTE QUE TEM UM PROGRAMA DE CRESCIMENTO NA EMPRESA E ACABA FICANDO ETERNAMENTE NO MESMO CARGO, SEM UMA EXPECTATIVA DE CRESCIMENTO', 0, 0, 91, 0, 0),
