(16514, 11, 'pkd6rxdy1387', 'direcao_justificativa', 'PODERIA MELHOR SER DIVULGADO OS OBJETIVOS DA EMPRESA, VEJO QUE MUITAS INFORMACOES, FICA RESTRITA NA MAO DE 3 A 4 PESSOAS. 10) OUSO MUITO AQUI E EM DOURADO E ASSIM, E NAO PODEMOS MUDAR E NEM MELHORAR, COMO ESTAMOS NUM SECULO XXI E AINDA TENDO CABECA FECHADA PARA AS INICIATIVAS, NEM AO MENOS TENDO A OPORTUNIDADE DE TESTAR.', 0, 0, 76, 0, 0),
