(16546, 11, 'pkd6rxdy1387', 'recursos_humanos4', '2', 0, 0, 76, 0, 0),
(16547, 11, 'pkd6rxdy1387', 'recursos_humanos_justificativa', '1) FALTA O RH CONHECER MAIS NO FISICO NOSSAS DINAMICAS DE FABRICA, PARECE QUE ELES VIVEM EM OUTRA REALIDADE. 2) FALTA UMA MELHOR QUALIDADE EM OUVIR AS NECESSIDADE, TUDO AS REPOSTAS DE MELHORIA SE ESBARRA NA FRASE MAS EM DOURADO E ASSIM, TEMOS QUE ENTENDER QUE DE CADA ESTADO TEM SE UMA PECULIARIDADE, ISSO FAZ MUITO A DIFERENCA EM  RETER PESSOAS E CONTRATAR. DIRETOR DE RH, OLHANDO POR FORA DAS SITUACOES E RESPOSTAS QUE TEMOS DE DIRECIONAL DELE PARA UNIDADE DO PR E MUITO LIMITADA, SE RESTRINGINDO MUITO A ISSO E O QUE FIZEMOS A 20 ANOS E VAI SER ASSIM, E LOGICO QUE ESTE TIPO DE MENTALIDADE SE REFLETE NA QUALIDADE DOS SERVICOS, SENDO MEDIANOS. TEMOS PESSOAS COM COMPROMETIMENTO E ATENCAO AOS COLABORADORES, POREM TEMOS TAMBEM A KELLY C. F. PINTO QUE E MUITO MAL EDUCADA COM TODOS A QUEM PROCURA, UM MAL HUMOR QUE QUANDO E IDICADO O COLABORADOR A FALAR COM ELA AS PESSOAS FALA DEIXA PRA LA SE NAO VAI ACABAR COM O MEU DIA, FALTA MUITA EDUCACAO E SIMPATIA A MESMA.', 0, 0, 76, 0, 0),
(16548, 11, 'pkd6rxdy1387', 'comunicacao_interna1', '2', 0, 0, 76, 0, 0),
