(16550, 11, 'pkd6rxdy1387', 'comunicacao_interna_justificativa', 'PODERIA MELHOR FAZER COM MAIS CAMPANHAS DE CONSCIENTIZACAO POR EXEMPLO.', 0, 0, 76, 0, 0),
(16551, 11, 'pkd6rxdy1387', 'seguranca_trabalho1', '2', 0, 0, 76, 0, 0),
(16552, 11, 'pkd6rxdy1387', 'seguranca_trabalho2', '2', 0, 0, 76, 0, 0),
(16553, 11, 'pkd6rxdy1387', 'seguranca_trabalho_justificativa', 'PODERIA TER MAIS A SEGURANCA DO TRABALHO EM CAMPO MELHOR ORIENTANDO AS AREAS, VEJO A SEGURANCA MUITO MAIS FOCA EM OBRAS E TERCEIRO, E SO VINDO PARA O CAMPO EM MOMENTOS DE QUASE ACIDENTE E ACIDENTES, FALTA MAIS ORIENTACOES E CAMPANHAS AO LOGO DO ANO, NAO SO LIMITANDO A SIPATMA.', 0, 0, 76, 0, 0),
(16554, 11, 'pkd6rxdy1387', 'trabalho', '2', 0, 0, 76, 0, 0),
(16555, 11, 'pkd6rxdy1387', 'comentario_fazenda', 'SUGESTAO DE MELHORIA O RELATORIO DE PESQUISA QUANTO OS CAMPOS DE TEXTOS COM QUEBRA DE LINHA E CAMPO QUE POSSA ENXERGAR TUDO QUE E DESCRITO.REALIZAR UMA PESQUISA DE MERCADO QUANTO A SALARIOS NA REGIAO, PERDEMOS MUITOS COLABORADORES PARA AS FABRICAS DA REGIAO POR MELHORES SALARIOS, MAIS ATRATIVOS, SEM CONTAR SER MAIS ATRATIVO PARA CONTRATACAO.AVALIAR UMA MELHOR ABRANGENCIA DE PONTOS NA REGIAO, PERDEMOS GRANDES TALENTOS POR NAO CONSEGUIRMOS COLOCAR UM PONTO A MAIS EM UMA RUA QUE O ONIBUS PASSA TODOS OS DIAS, MAIS UMA VEZ, SABER OLHAR AO TODO.AVALIAR DE COLOCARMOS A QUINTA TROCA DE UNIFORME A TODOS, MAIS UMA VEZ A REGIAO DO PR E MUITO UMIDA E CHUVOSA, TEMOS CASOS E BOA PARTE DO ANO, COM COLABORADORES VINDO DE UNIFORME UMIDO TRABALHAR POR DIFICULDADE DE SECAGEM. SUGESTAO DE AVALIAR DE TERMOS UMA VACINACAO EM MASSA DA GRIPE, EM EPOCAS MAIS FRIAS SOFREMOS BASTANTE COM AFASTAMENTOS PELA DOENCA.', 0, 0, 76, 0, 0),
