(16699, 12, 'reyn0hm4wp327', 'gestores_justificativa', 'AQUI ESTOU FALANDO DO MEU GESTOR DANILO REFERENTE AO ANO ATRAS , ELE SEMPRE ME ENSINOU , NUNCA TIVE PROBLEMA COM ELE , POREM MUITA COISA QUE ELE ERRA ELE DIFICILMENTE ACEITA O ERRO ,PROCURA SEMPRE UM CULPADO . POIS ELE SABE TUDO NO PONTO DE VISTA DELE , SO ELE TA CERTO SEMPRE . POREM ELE ME ENSINOU MUITO , ME DEU MUITA RESPONSABILIDADE PARA ME MOSTRAR QUE EU ERA CAPAZ .SE EU FOR FALAR DO MEU GESTOR ATUAL QUE E O CARDOSO EM TODOS EU COLOCARIA CONCORDO TOTALMENTE,  POIS ELE E UM PROFISSIONAL INTEGRO , DE FACIL ACESSO , QUE ENSINA E VALORIZA AS PESSOAS .', 0, 0, 0, 0, 0),
