(16704, 12, 'reyn0hm4wp327', 'recursos_humanos_justificativa', 'NOSSO RH DAQUI AS VEZES E MUITO GROSSO COM OS COLABORADORES , E ACHO QUE PARA SER DO RH TU TEM QUE TER MAIS JEITO E CUIDADO AO FALAR COM AS PESSOAS , E MAIS DISPONIBILIDADE , NAO SIMPLESMENTE FALA P COLABORADOR AMANHA FALO CONTIGO PQ TA NO HORARIO DE EU IR PARA CASA . LOGICO TODOS DEVEMOS CUMPRIR HORAROO , CORRETO , MAS QUANDO SE TRAVA EM ALGUMA DUVIDA OU COMVERSA QUE O COLABORADOR QUE TER , O RH TEM QUE TER UM JOGO DE CINTURA MELHOR EM TRATA E COMVERSAR COM A PESSOA . NAO SIMPLESMENTE SAI CORRENDO PQ ESTA NA HORA DE IR EMBORA E DEIXA O COLABORAR ALI . ACHO QUE E ISSO QUE ELA PECA MT , NO TRATAR AS PESSOAS .', 0, 0, 0, 0, 0),
