(16829, 10, 'pvpanc9sq997', 'direcao_justificativa', 'DO ANO PASSADO PRA CA A EMPRESA NAO MELHOROU MUITO, POIS SO INVES DE MOTIVAR O TRABALHO EM EQUIPE, ELA FAZ COM QUE TODOS CONCORDAM UNS COM OS OUTROS GERANDO INIMIZADES, DESLEALDADE, FALTA DE ETICA E ETC. E TAMBEM DEVIDO A ISSO A ROTINA DE TRABALHO FICOU MUITO MAIS CANSATIVA O QUE NOS LEVA A UMA EXAUSTAO DIARIA POR TER QUE EXECUTAR MUITO TRABALHO EM POUCO TEMPO. E A EMPRESA DIFICILMENTE OUVE AS OPINIOES QUE FORNECEMOS PARA MELHORIA DO NOSSO TRABALHO', 0, 0, 92, 0, 0),
