(16856, 10, 'pvpanc9sq997', 'gestores18', '3', 0, 0, 92, 0, 0),
(16857, 10, 'pvpanc9sq997', 'gestores_justificativa', 'E MUITA COISA PRA JUSTIFICAR, VOU RESUMIR PARA QUE QUEM ESTIVER LENDO CONSIGA ENTENDER PELO MENOS EM PARTE A SITUACAO. A MINHA GESTORA, NAO NOS MOTIVA A ADQUIRIR MAIS CONHECIMENTOS, MUITAS VEZES ELE AGE PARCIALMENTE, ELA NAO SABE SER IMPARCIAL COM A EQUIPE, GERANDO DESCONFORTO ENTRE OS MEMBROS DA EQUIPE. MUITOS NAO TEM CORAGEM DE FALAR, POIS TEM RECEIO, MAS A PREMIER TEM MUITOS PROMOTORES DESMOTIVADOS DEVIDO A LIDERANCA, E CORRE O RISCO DE PERDER BONS PROFISSIONAIS DEVIDO A FALTA DE HABILIDADE DO GESTOR EM GERIR DE FORMA CORRETA. O RECONHECIMENTO SO EXISTE PARA ALGUMAS PESSOAS QUE NEM SE QUER SAO AS MELHORES DA EQUIPE, NAO VAO BEM NAS CAMPANHAS E MESMO ASSIM SAO PRIVILEGIADAS EM DETRIMENTO DAQUELES QUE REALMENTE ENTREGAM NUMEROS POSITIVOS A EMPRESA.', 0, 0, 92, 0, 0),
