(16871, 10, 'pvpanc9sq997', 'comentario_fazenda', 'A PREMIERPET E UMA OTIMA EMPRESA, A UNICA COISA QUE REALMENTE ESTA NOS DEIXANDO UM POUCO DESMOTIVADOS ( FALO NO PLURAL POIS MUITOS COLEGAS VEM FALAR COMIGO SOBRE ISSO), E A FALTA DE OPORTUNIDADES DE CRESCIMENTO DENTRO DA ORGANIZACAO, ALIADO A MA GESTAO DE NOSSA GESTORA IMEDIATA, QUE COMO JA CITEI ANTERIORMENTE, NAO SER IMPARCIAL E NAO NOS FORNECE TODO O APARATO NECESSARIO PARA SERMOS AINDA MELHORES. ESTOU NA EMPRESA A ALGUNS ANOS E NUNCA NEM SE QUER TIVE UM RETORNO DA GESTORA EM RELACAO A TRILHA DE CARREIRAS. ESPERO QUE CONSIGAM COMPREENDER O QUE ESTOU TENTANDO MOSTRAR PRA VOCES, ANTES QUE PERCAM BONS TALENTOS POR CULPA DE UMA MA GESTAO.', 0, 0, 92, 0, 0),
