(17690, 8, 'plcuvau47778', 'recursos_humanos_justificativa', 'SOBRE O RH, NAO TEM UM ITEM ESPECIFICO PARA ISSO, ENTAO COLOQUEI NO ULTIMO. ACHO QUE FALTA ESTABELECER ALGUNS PROCESSOS PARA AJUDAR OS COLABORADORES A VISUALIZAR SEU FUTURO DENTRO DA EMPRESA. COMO UM PLANO DE CARREIRA ESPECIFICO POR CARGO E BEM DEFINIDO. AS PROMOCOES NAO DEVEM SER LIMITADAS A UM PERIODO DE 1 ANO NO CARGO, PORQUE TUDO MUDA RAPIDAMENTE.', 0, 0, 51, 0, 0),
