(17702, 8, 'plcuvau47778', 'comentario_fazenda', 'SOU MUITO FELIZ TRABALHANDO NA PREMIER, PRINCIPALMENTE NO MEU SETOR, TEMOS UM CLIMA OTIMO, DE HARMONIA, O QUE AJUDA BASTANTE A DESENVOLVER UM TRABALHO DE QUALIDADE E EM EQUIPE. SUGESTOES:COMIDA DO RESTAURANTE TEM QUE MELHORAR - PODERIA AJUSTAR O VALOR SE NECESSARIORETIRADA DE BRINDES, PODERIA SER POR SETOR, EVITANDO FILAS IMENSAS. USAR NOSSO CRACHA NAS PALESTRAS AO INVES DE ASSINAR FOLHAS. PASSA O CRACHA EM UMA MAQUINHA SEMELHANTE AO PONTO E FICA REGISTRADO A PRESENCA.', 0, 0, 51, 0, 0),
