(18317, 8, 'pyvrrdly1470', 'direcao_justificativa', 'ALGUNS PROCESSO SAO BEM ESTABELECIDOS NA EMPRESA, POREM OUTROS PRECISAM MELHORAR MUITO, SAO MUITAS AS SITUACOES QUE E CLARO A FALTA DE ALINHAMENTO E COMUNICACAO ENTRE OS DEPARTAMENTOS E ATE MESMO DENTRO DO MESMO DEPARTAMENTO, NO ULTIMO ANO ISSO PIOROU E ESSA INSTABILIDADE NOS PROCESSO, FALTA DE PADRAO E MUDANCAS REPENTINAS NO DIRECIONAMENTO DESESTIMULA O COLABORADOR.', 0, 0, 51, 0, 0),
