(18345, 8, 'pyvrrdly1470', 'gestores_justificativa', 'GOSTARIA DE SUGERIR QUE O GESTOR DA EQUIPE DEDIQUE MAIS TEMPO A ORGANIZACAO E AO PLANEJAMENTO ESTRATEGICO DOS PROJETOS, O QUE PERMITIRIA UMA GESTAO MAIS EFICIENTE DAS DEMANDAS. PERCEBO QUE A REALIZACAO DE MUITAS ATIVIDADES OPERACIONAIS INTERFERE NA CAPACIDADE DE ATENDER A TODAS AS PRIORIDADES. DELEGAR MAIS TAREFAS OPERACIONAIS A EQUIPE PODE AJUDAR A MELHORAR O FOCO NAS METAS PRINCIPAIS E OTIMIZAR O ANDAMENTO DOS PROJETOS', 0, 0, 51, 0, 0),
