(18362, 8, 'pyvrrdly1470', 'comentario_fazenda', 'A EMPRESA TEM MUITAS QUALIDADES, OFERECE UM AMBIENTE DE TRABALHO MUITO BOM, NAO FALTAM RECURSOS PARA A REALIZACAO DAS DEMANDAS, INVESTE NA CAPACITACAO DOS COLABORADORES, ACREDITO NA QUALIDADE DOS PRODUTOS QUE SAO COLOCADOS NO MERCADO E E CONSOLIDADA NO MERCADO. ALGUMAS SUGESTOES DE MELHORIA SERIAM A DISPOSICAO DE UM VALE ALIMENTACAO AO INVES DA CESTA BASICA, MESMO QUE EM UM VALOR INFERIOR AO TOTAL DA CESTA BASICA, MELHORAR A QUALIDADE DA COMIDA DO REFEITORIO, CRIAR UM CALENDARIO ANUAL COM OS FERIADOS, SE NAO FOR POSSIVEL ANUAL, AO MENOS SEMESTRAL, PARA QUE AS PESSOAS CONSIGAM SE PROGRAMAR, ISSO TEM UMA GRADE IMPACTO NA QUALIDADE DE VIDA DO COLABORADOR. VIRAR UM EMPRESA CIDADA PARA TER LICENCA MATERNIDADE E PATERNIDADE ESTENDIDAS, E INVESTIR EM ESTRUTURACAO DE PROCESSO DENTRO DE CADA DEPARTAMENTO EM TODOS OS NIVEIS DE COMPLEXIDADE.', 0, 0, 51, 0, 0),
